# -*- coding: utf-8 -*-

import base64

from platformcode import config, logger, platformtools
from core.item import Item

from core import channeltools, scrapertools

all_genres_64 = ''
all_genres = eval(base64.b64decode(all_genres_64))


color_list_proxies = config.get_setting('channels_list_proxies_color', default='red')


def mainlist(item):
    logger.info()
    itemlist = []

    item.category = 'Gneros en canales'

    descartar_xxx = config.get_setting('descartar_xxx', default=False)

    for genero in sorted(all_genres.keys()):
        if descartar_xxx and genero == 'X (adultos +18)': continue

        itemlist.append(item.clone( action='genero', genero=genero, title=genero, text_color='moccasin' ))

    return itemlist


def genero(item):
    logger.info()
    itemlist = []

    channels_list_status = config.get_setting('channels_list_status', default=0)

    item.category = item.genero

    for enlace in sorted(all_genres[item.genero], key=lambda it: (it['search_type'], it['channel'], it['title'])):
        ch = channeltools.get_channel_parameters(enlace['channel'])

        if not ch['active']: continue
        elif ch['status'] == -1: continue

        if config.get_setting('mnu_problematicos', default=False):
            if 'problematic' in ch['clusters']: continue

        if channels_list_status > 0:
            if not ch['status'] == 1: continue

        cfg_proxies_channel = 'channel_' + ch['id'] + '_proxies'

        if enlace['search_type'] == 'movie':
            txt = 'Pelculas'
            color = 'deepskyblue'
        else:
            txt = 'Series'
            color = 'hotpink'

        titulo = '[COLOR %s]%s [/COLOR][COLOR cyan]%s[/COLOR] %s' % (color, txt, enlace['title'], ch['name'])

        if config.get_setting(cfg_proxies_channel, default=''): titulo += '[I][COLOR %s] (proxies)[/COLOR][/I]' % color_list_proxies

        if 'register' in ch['clusters']:
            cfg_user_channel = 'channel_' + ch['id'] + '_' + ch['id'] +'_username'
            cfg_pass_channel = 'channel_' + ch['id'] + '_' + ch['id'] +'_password'
            if not config.get_setting(cfg_user_channel, default='') or not config.get_setting(cfg_pass_channel, default=''):
               titulo += '[I][COLOR teal] (cuenta)[/COLOR][/I]'
            else:
               cfg_login_channel = 'channel_' + ch['id'] + '_' + ch['id'] +'_login'

               if config.get_setting(cfg_login_channel, default=False): titulo += '[I][COLOR teal] (sesion)[/COLOR][/I]'
               else: titulo += '[I][COLOR teal] (login)[/COLOR][/I]'

        if 'inestable' in ch['clusters']:
            if config.get_setting('mnu_simple', default=False): continue
            elif config.get_setting('channels_list_no_inestables', default=False): continue

            titulo += '[I][COLOR plum] (inestable)[/COLOR][/I]'

        if 'problematic' in ch['clusters']:
            if config.get_setting('mnu_simple', default=False): continue
            elif config.get_setting('channels_list_no_problematicos', default=False): continue

            titulo += '[I][COLOR darkgoldenrod] (problemtico)[/COLOR][/I]'

        zoo_genre = ''

        if ch['id'] == 'zoowomaniacos':
            zoo_genre = scrapertools.find_single_match(str(enlace), ".*?a5.*?': '(.*?)'").strip()

        it = Item( channel=ch['id'], title = titulo, thumbnail = ch['thumbnail'], category = item.genero + ' @ ' + ch['name'], zoo_genre = enlace['title'])

        for x in enlace:
            if x not in ['channel', 'title']: it.__dict__[x] = enlace[x]

        itemlist.append(it)

    return itemlist
